import React from "react";
import { Modal, View, Text, TouchableHighlight, StyleSheet } from "react-native";

export default function alertModal(modalVisible: boolean, setModalVisible:React.Dispatch<any>) {
  return (
    <Modal
      animationType="slide"
      transparent={true}
      visible={modalVisible}>
      <View style={styles.centeredView}>
        <View style={styles.modalView}>
          <Text style={styles.modalText}>Oops, the roles didn't add up. Have everyone double check their roles</Text>
          <TouchableHighlight
            style={{ ...styles.okButton, backgroundColor: "#2196F3" }}
            onPress={() => {
              setModalVisible(!modalVisible);
            }}>
            <Text style={styles.textStyle}>OK</Text>
          </TouchableHighlight>
        </View>
      </View>
    </Modal>
  );
};
